import { React } from "react";

import "./register_style.css"
import "../../styles/global.css"

import left_arrow from "../../img/left_arrow.png"

function Register() {
    return (
        <body>

            <img 
                src={left_arrow} 
                
            />

            <div className="register-container">
                <h1>Registro</h1>
            </div>
        </body>
    )
}

export default Register;
